卡特兰数。枚举子树大小累计。

```rust
impl Solution {
    pub fn num_trees(n: i32) -> i32 {
        let mut cnt = vec![0; n as usize + 1];
        cnt[0] = 1;
        cnt[1] = 1;
        for i in 2..=n as usize {
            for j in 0..i {
                cnt[i] += cnt[j] * cnt[i - 1 - j];
            }
        }
        cnt[n as usize]
    }
}
